window.bookSummaryJSON = "<p><b>The explosive third novel in James S.A. Corey's </b><b><i>New York Times </i></b><b>best-selling Expanse series. Now a major television series.</b></p> <p><b>Hugo Award Winner for Best Series</b></p> <p>For generations, the solar system - Mars, the Moon, the Asteroid Belt - was humanity's great frontier. Until now. The alien artifact working through its program under the clouds of Venus has appeared in Uranus's orbit, where it has built a massive gate that leads to a starless dark.</p> <p>Jim Holden and the crew of the <i>Rocinante</i> are part of a vast flotilla of scientific and military ships going out to examine the artifact. But behind the scenes, a complex plot is unfolding, with the destruction of Holden at its core. As the emissaries of the human race try to find whether the gate is an opportunity or a threat, the greatest danger is the one they brought with them.&nbsp;</p> <p><i>Abaddon's Gate </i>is a breakneck science-fiction adventure following the critically acclaimed <i>Caliban's War</i>.</p> <p><b>The Expanse: </b><i>Leviathan Wakes</i>, <i>Caliban's War</i>, <i>Abaddon's Gate</i>,<i> Cibola Burn</i>,<i> Nemesis Games, Babylon's Ashes</i>, <i>Persepolis Rising</i></p> <p><b>The Expanse Short Fiction: </b><i>The Butcher of Anderson</i>,<i> Station</i>,<i> Gods of Risk</i>, <i>The Churn</i>,<i> The Vital</i>, <i>Abyss</i>,<i> Strange Dogs</i></p>"; 
